{"": "", "Configure": "\u067e\u06cc\u06a9\u0631\u0628\u0646\u062f\u06cc", "Create": "\u0627\u06cc\u062c\u0627\u062f \u06a9\u0631\u062f\u0646", "Default root password is <code>admin</code>": "\u06a9\u0644\u0645\u0647 \u0639\u0628\u0648\u0631 \u067e\u06cc\u0634\u0641\u0631\u0636 \u06a9\u0627\u0631\u0628\u0631 \u0631\u0648\u062a <code>admin</code> \u0645\u06cc\u0628\u0627\u0634\u062f.", "Filesystem root": "\u0631\u06cc\u0634\u0647 \u0633\u06cc\u0633\u062a\u0645 \u0641\u0627\u06cc\u0644", "New password": "\u0631\u0645\u0632 \u0639\u0628\u0648\u0631 \u062c\u062f\u06cc\u062f", "New user name": "\u0646\u0627\u0645 \u06a9\u0627\u0631\u0628\u0631\u06cc \u062c\u062f\u06cc\u062f", "OK": "\u062a\u0627\u06cc\u06cc\u062f", "Permissions": "\u062f\u0633\u062a\u0631\u0633\u06cc\u200c\u0647\u0627", "Save": "\u0630\u062e\u06cc\u0631\u0647", "Sidebar entries": "\u0645\u0648\u0627\u0631\u062f \u0646\u0648\u0627\u0631 \u06a9\u0646\u0627\u0631\u06cc", "System account": "\u062d\u0633\u0627\u0628 \u0633\u06cc\u0633\u062a\u0645\u06cc", "This only affects appearance of the sidebar. Disable actual permissions under the <b>Permissions</b> tab.": "\u0627\u06cc\u0646 \u062a\u0646\u0647\u0627 \u0631\u0648\u06cc \u0638\u0627\u0647\u0631 \u0646\u0648\u0627\u0631 \u06a9\u0646\u0627\u0631\u06cc \u062a\u0627\u062b\u06cc\u0631 \u0645\u06cc\u06af\u0630\u0627\u0631\u062f.\u0645\u062c\u0648\u0632 \u0647\u0627\u06cc \u0627\u0635\u0644\u06cc \u0631\u0627 \u062f\u0631 \u0642\u0633\u0645\u062a <b>\u0645\u062c\u0648\u0632 \u0647\u0627</b> \u063a\u06cc\u0631 \u0641\u0639\u0627\u0644 \u06a9\u0646\u06cc\u062f.", "This user will be constrained by POSIX permissions for the selected system account.": "\u0627\u06cc\u0646 \u06a9\u0627\u0631\u0628\u0631 \u062a\u0648\u0633\u0637 \u0645\u062c\u0648\u0632 \u0647\u0627\u06cc POSIX \u0628\u0631\u0627\u06cc \u062d\u0633\u0627\u0628 \u0633\u06cc\u0633\u062a\u0645\u06cc \u0627\u0646\u062a\u062e\u0627\u0628 \u0634\u062f\u0647 \u0645\u062d\u062f\u0648\u062f \u062e\u0648\u0627\u0647\u062f \u0634\u062f", "Update password": "\u0628\u0647 \u0631\u0648\u0632 \u0631\u0633\u0627\u0646\u06cc \u0631\u0645\u0632 \u0639\u0628\u0648\u0631", "You have no users mapped to <b>root</b> system account. Saving this configuration will prevent any administrative access.": "\u0634\u0645\u0627 \u0647\u06cc\u0686 \u06a9\u0627\u0631\u0628\u0631\u06cc \u0631\u0627 \u0628\u0631\u0627\u06cc \u062d\u0633\u0627\u0628 \u0633\u06cc\u0633\u062a\u0645\u06cc <b>\u0631\u0648\u062a</b> \u0645\u0634\u062e\u0635 \u0646\u06a9\u0631\u062f\u0647 \u0627\u06cc\u062f.\u0630\u062e\u06cc\u0631\u0647 \u06a9\u0631\u062f\u0646 \u0627\u06cc\u0646 \u067e\u06cc\u06a9\u0631\u0628\u0646\u062f\u06cc \u0627\u0632 \u0647\u0631\u06af\u0648\u0646\u0647 \u062f\u0633\u062a\u0631\u0633\u06cc \u0645\u062f\u06cc\u0631\u06cc\u062a\u06cc \u062c\u0644\u0648\u06af\u06cc\u0631\u06cc \u062e\u0648\u0627\u0647\u062f \u06a9\u0631\u062f.", "Custom users": "\u06a9\u0627\u0631\u0628\u0631\u0627\u0646 \u0633\u0641\u0627\u0631\u0634\u06cc", "Users": "\u06a9\u0627\u0631\u0628\u0631\u0627\u0646", "Password updated": "\u06a9\u0644\u0645\u0647 \u0639\u0628\u0648\u0631 \u0628\u0647 \u0631\u0648\u0632 \u0631\u0633\u0627\u0646\u06cc \u0634\u062f."}